【キッズ用リモコン】
<br><br>
■カーナビゲーションと液晶モニター「TVM-
W7000/W6500」をリアモニターとして組合わせたときに、TVやDVD-VIDEO/CD/MP3などの操作を後部座席で行うためのリモコン。 <br>
<br>
対応カーナビゲーション<br>
AVIC-DRZ009/DRV005/DRV002/
DRZ99/DRV55/DRV22/DRZ09/DRV05/
DRV02/DRZ90/DRZ80/DRV50/DRV20/
DRV250/DRV220/DRV150/DRV120<br> 
