【システムコミュニケーター取付アーム】
<br><br>
シート固定ネジに取付けて、メイン（リモート）コントローラーを設置するときに使用する取付アーム。 <br>
<br>
※車種によって取付できない場合があります。 <br> 
※取付けにはリモコンのマウンティングベースを使用するため、マウンティングベースを付属していないリモコンには使用できません。<br> 
