【アドオン・ステアリングリモコンについて】<br>
1.標準装備以外のステアリング、オプション等が装着されている場合には取付けできません。<br>
2.本製品は赤外線送信タイプのリモコンです。<br>X088/X08Sのリモコン受光部に受光部カバーを貼り付けて使用します。<br>
3.メインユニットのリモコン受光部に直射日光が当たっていると本機の操作が出来ない場合があります。<br>
4.ハンドルの回転操作中は、本機での操作が出来ません。<br>
5.ステアリングリモコンの動作範囲は、ステアリングをまっすぐにした状態から左右10度ずつが目安です。
